Monty Python and the Holy Grail (1975)

Verenigd Koninkrijk
Komedie
91 minuten

geregisseerd door Terry Gilliam en Terry Jones
met Graham Chapman, John Cleese en Eric Idle

Koning Arthur gaat met zijn trouwe kokosnotenklapper Patsy 
(als goedkoop substituut voor een edel ros) op zoek naar ridders 
die de Ronde Tafel waardig zijn. Sir Launcelot, Sir Bedevere en 
Sir Galahad sluiten zich bij de koning aan, maar ook de minder 
bekende, en zoals zijn minstreel graag benadrukt, iets minder 
dappere Sir Robin sluit zich aan. Op een bepaald moment verschijnt 
God aan Arthur en zijn gevolg, en hij geeft hen de opdracht de Heilige 
Graal te zoeken. De ridders gaan elk apart op zoek naar de graal, maar 
hun queeste is niet zonder moeilijkheden
